<template>
  <view class="normal-login-container">
    <view class="logo-content">
      <text class="title">欢迎登录 害堤动物防治</text>
    </view>
    <view class="login-form-content">
      <view class="input-item flex align-center">
        <input
          v-model="username"
          class="input"
          type="text"
          placeholder="请输入您的账号"
          maxlength="30"
        />
      </view>
      <view class="input-item flex align-center">
        <input
          v-model="password"
          type="password"
          class="input"
          placeholder="请输入您的密码"
          maxlength="20"
        />
      </view>
      <view class="action-btn">
        <button
          @click="handleLogin"
          class="login-btn cu-btn block bg-blue lg round"
        >
          登录
        </button>
      </view>
    </view>

    <!-- <view class="xieyi text-center">
      <text class="text-grey1">登录即代表同意</text>
      <text @click="handleUserAgrement" class="text-blue">《用户协议》</text>
      <text @click="handlePrivacy" class="text-blue">《隐私协议》</text>
    </view> -->
  </view>
</template>

<script>
import { getCodeImg } from "@/api/login";

export default {
  data() {
    return {
      codeUrl: "",
      captchaEnabled: true,
      globalConfig: getApp().globalData.config,
      // username: "13521962466",
      // password: "123456",
      username: "",
      password: "",
      loginForm: {
        username: "",
        password: "",
      },
    };
  },
  onShow() {},
  created() {
    // this.getCode();
  },
  // 分享给朋友
  onShareAppMessage() {
    return {
      title: "害堤动物防治",
      // imageUrl: '分享图片链接',
      path: "pages/index1",
      success() {
        console.log("分享成功");
      },
      fail(err) {
        console.error("分享失败", err);
      },
    };
  },
  methods: {
    // 隐私协议
    handlePrivacy() {
      let site = this.globalConfig.appInfo.agreements[0];
      this.$tab.navigateTo(
        `/pages/common/webview/index?title=${site.title}&url=${site.url}`
      );
    },
    // 用户协议
    handleUserAgrement() {
      let site = this.globalConfig.appInfo.agreements[1];
      this.$tab.navigateTo(
        `/pages/common/webview/index?title=${site.title}&url=${site.url}`
      );
    },
    // 获取图形验证码
    getCode() {
      getCodeImg().then((res) => {
        this.captchaEnabled =
          res.captchaEnabled === undefined ? true : res.captchaEnabled;
        if (this.captchaEnabled) {
          this.codeUrl = "data:image/gif;base64," + res.img;
          this.loginForm.uuid = res.uuid;
        }
      });
    },
    // 登录方法
    async handleLogin() {
      if (this.username === "") {
        this.$modal.msgError("请输入您的账号");
      } else if (this.password === "") {
        this.$modal.msgError("请输入您的密码");
      }
      // else if (this.loginForm.code === "" && this.captchaEnabled) {
      //   this.$modal.msgError("请输入验证码");
      // }
      else {
        this.$modal.loading("登录中，请耐心等待...");
        this.pwdLogin();
      }
    },
    // 密码登录
    async pwdLogin() {
      // this.loginForm.username = this.username;
      // this.loginForm.password = this.password;
      this.loginForm.username = this.stringToBase64(this.username);
      this.loginForm.password = this.stringToBase64(this.password);
      let name = this.stringToBase64(this.username);
      let pass = this.stringToBase64(this.password);
      this.$store
        .dispatch("Login", { username: name, password: pass })
        .then(() => {
          this.$modal.closeLoading();
          this.loginSuccess();
        });
      // .catch(() => {
      //   if (this.captchaEnabled) {
      //     this.getCode();
      //   }
      // });
    },
    // 登录成功后，处理函数
    loginSuccess(result) {
      this.$tab.reLaunch("/pages/index");
    },
    stringToBase64(str) {
      // return btoa(unescape(encodeURIComponent(str)));
      return this.base64_encode(
        encodeURIComponent(str).replace(/%([0-9A-F]{2})/g, (match, p1) =>
          String.fromCharCode("0x" + p1)
        )
      );
    },
    base64_encode(str) {
      var c1, c2, c3;
      var base64EncodeChars =
        "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";
      var i = 0,
        len = str.length,
        string = "";

      while (i < len) {
        c1 = str.charCodeAt(i++) & 0xff;
        if (i == len) {
          string += base64EncodeChars.charAt(c1 >> 2);
          string += base64EncodeChars.charAt((c1 & 0x3) << 4);
          string += "==";
          break;
        }
        c2 = str.charCodeAt(i++);
        if (i == len) {
          string += base64EncodeChars.charAt(c1 >> 2);
          string += base64EncodeChars.charAt(
            ((c1 & 0x3) << 4) | ((c2 & 0xf0) >> 4)
          );
          string += base64EncodeChars.charAt((c2 & 0xf) << 2);
          string += "=";
          break;
        }
        c3 = str.charCodeAt(i++);
        string += base64EncodeChars.charAt(c1 >> 2);
        string += base64EncodeChars.charAt(
          ((c1 & 0x3) << 4) | ((c2 & 0xf0) >> 4)
        );
        string += base64EncodeChars.charAt(
          ((c2 & 0xf) << 2) | ((c3 & 0xc0) >> 6)
        );
        string += base64EncodeChars.charAt(c3 & 0x3f);
      }
      return string;
    },
  },
};
</script>

